import React from 'react';
import { Link } from "react-router-dom";
import styles from './index.module.css';

const MainPage = () => {
    return (
        <body >
            <section class={styles.path}>
                <div class={styles.pathGrid1}>
                   <button class={styles.button1}><Link class={styles.link} to="/pathfinder">Star Wars</Link></button>
                </div>
                <div class={styles.pathGrid2}>
                   <button class={styles.button2}><Link class={styles.link} to="/pathdragon">Dragon Ball</Link></button>
                </div>
            </section>
        </body>
    )
};

export default MainPage;
